    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "E\u011fer birim \u00f6nceden yay\u0131nlanm\u0131\u015fsa ve \u00f6\u011frencilere serbest b\u0131rak\u0131lm\u0131\u015fsa, birim gizli oldu\u011fu zamanki yapt\u0131\u011f\u0131n\u0131z de\u011fi\u015fiklikler \u015fimdi \u00f6\u011frencilere g\u00f6r\u00fcn\u00fcr olacakt\u0131r. Devam etmek istiyor musunuz?", 
